import java.util.HashMap;
import java.util.Map;

/**
 * Given two strings A and B of lowercase letters, return true if and only if we can swap two letters in A so that the result equals B.
 *
 *
 *
 * Example 1:
 *
 * Input: A = "ab", B = "ba"
 * Output: true
 * Example 2:
 *
 * Input: A = "ab", B = "ab"
 * Output: false
 * Example 3:
 *
 * Input: A = "aa", B = "aa"
 * Output: true
 * Example 4:
 *
 * Input: A = "aaaaaaabc", B = "aaaaaaacb"
 * Output: true
 * Example 5:
 *
 * Input: A = "", B = "aa"
 * Output: false
 *
 *
 * Constraints:
 *
 * 0 <= A.length <= 20000
 * 0 <= B.length <= 20000
 * A and B consist only of lowercase letters.
 */
public class BuddyStrings {
    //Performance issue
    public boolean buddyStrings_byForce(String A, String B) {
        if (A == null || B == null || A.length() != B.length())
            return false;

        char[] charsInA = A.toCharArray();
        for (int i = 0; i < charsInA.length; i++) {
            for (int j = i+1; j < charsInA.length; j++) {
                swap(charsInA, i, j);

                if (String.valueOf(charsInA).equals(B)) return true;
                swap(charsInA, i, j);
            }
        }
        return false;
    }

    private void swap(char[] charsInA, int i, int j) {
        char temp = charsInA[i];
        charsInA[i] = charsInA[j];
        charsInA[j] = temp;
    }

    public boolean buddyStrings(String A, String B) {
        if (A == null || B == null || A.length() == 0 || B.length() == 0
                || A.length() != B.length())
            return false;

        Map<Integer, Character> mapADiff = new HashMap<>();
        Map<Integer, Character> mapBDiff = new HashMap<>();

        Map<Integer, Character> mapA = new HashMap<>();
        boolean abAreSame = true;
        boolean hasDuplicationChars = false;
        int pos = 0;
        for (int i = 0; i < A.length(); i++) {
            if (A.charAt(i) != B.charAt(i)) {
                mapADiff.put(pos, A.charAt(i));
                mapBDiff.put(pos, B.charAt(i));
                pos++;
                if (pos > 2) return false;

                abAreSame = false;
            }

            if (mapA.containsValue(A.charAt(i))) {
                hasDuplicationChars = true;
            }
            else {
                mapA.put(i, A.charAt(i));
            }
        }

        if (abAreSame && hasDuplicationChars) return true;

        if (mapADiff.size() != 2) return false;
        return mapADiff.get(0).equals(mapBDiff.get(1))
                && mapADiff.get(1).equals(mapBDiff.get(0));
    }

    public static void main(String[] args) {
        BuddyStrings buddyStrings = new BuddyStrings();
        System.out.println(buddyStrings.buddyStrings("ab", "ba")); // true
        System.out.println(buddyStrings.buddyStrings("ab", "ab")); //false
        System.out.println(buddyStrings.buddyStrings("aa", "aa")); //true
        System.out.println(buddyStrings.buddyStrings("aaaaaaabc", "aaaaaaacb")); //true
        System.out.println(buddyStrings.buddyStrings("", "aa")); //false
        System.out.println(buddyStrings.buddyStrings("ab", "ca")); //false
        System.out.println(buddyStrings.buddyStrings("abab", "abab")); //true

        //true
        System.out.println(buddyStrings.buddyStrings("",
                ""));
    }
}
